function enemyAttack () {
    if (Math.randomRange(0, 1) == 0) {
        game.showLongText("Enemy used \"Head Bash\"", DialogLayout.Top)
        playerHealth += Math.randomRange(0, 10)
        game.showLongText("Ouch!", DialogLayout.Top)
    } else {
        game.showLongText("Enemy used \"Wrong Download Button\"", DialogLayout.Top)
        playerHealth += Math.randomRange(0, 20)
        game.showLongText("Ouch!", DialogLayout.Top)
    }
    if (playerHealth <= 0) {
        game.over(false, effects.dissolve)
    }
}
