function playerAttack () {
    attackChosen = 0
    while (attackChosen == 0) {
        if (game.ask("Throw Banana", "Mele Attack - 10 DMG")) {
            attackChosen = 1
            game.showLongText("You used \"Throw Banana\"", DialogLayout.Bottom)
            enemyHealth += -10
            game.showLongText("It was rather effective.", DialogLayout.Bottom)
        } else if (game.ask("Decompile", "Range Attack - 20 DMG")) {
            attackChosen = 1
            game.showLongText("You used \"Decompile\"", DialogLayout.Bottom)
            enemyHealth += -20
            game.showLongText("It was rather effective.", DialogLayout.Bottom)
        }
    }
}
